INSERT INTO `blog_article` VALUES (1,'','','### viewport \r\n```html\r\n<meta name=\"viewport\" content=\"width=device-width,initial-scale=1.0,minimum-scale=1.0,maximum-scale=1.0,user-scalable=no\" />\r\nwidth=device-width() \r\ninitial-scale=1.0() \r\nminimum-scale=1.0()\r\nmaximum-scale=1.0()\r\nuser-scalable=no(yes/no,)\r\n```\r\n\r\n[](https://www.cnblogs.com/2050/p/3877280.html \"\"){:target=\"_blank\"}','article_img/2019/04/25/html5.jpg','<h3 id=\"viewport\">viewport </h3>\n<pre class=\"codehilite\"><code class=\"language-html\">&lt;meta name=&quot;viewport&quot; content=&quot;width=device-width,initial-scale=1.0,minimum-scale=1.0,maximum-scale=1.0,user-scalable=no&quot; /&gt;  \nwidth=device-width()   \ninitial-scale=1.0()   \nminimum-scale=1.0()  \nmaximum-scale=1.0()  \nuser-scalable=no(yes/no,)  </code></pre>\n\n\n<p><a href=\"https://www.cnblogs.com/2050/p/3877280.html\" target=\"_blank\" title=\"\"></a></p>',189,2,'2019-04-25 17:26:04.694351','2019-04-25 17:26:04.694351',1,4,1,'p'),(2,'pycharmscss','CSSWebCSS,Sass  CSS  CSS  (variables) (nested rules) (mixins) (inline import),.','CSSWebCSS,Sass  CSS  CSS  (variables) (nested rules) (mixins) (inline import),.\r\n### RubySass\r\n\r\nPycharmScss,ScssRuby,,Ruby,[](https://rubyinstaller.org/downloads/ \"\"){:target=_blank},,next,`cmd`,`ruby -v``ruby`ruby,,`sass`,`cmd``gem install sass`,!\r\n\r\n### Pycharmfile watcher\r\n\r\n`File -> Settings -> Tools -> File Watchers``+``SCSS`\r\n```Scss\r\nName: SCSS\r\nFile type: SCSS Style Sheet\r\nScope: Project\r\nProgram: sass\r\nArguments: --style expanded --no-cache --update $FilePath$\r\nOutput paths to refresh: $FileName$:$ProjectFileDir$/css/$FileNameWithoutExtension$.css\r\n```\r\n`SCSS`~','article_img/2019/04/26/scss.png','<p>CSSWebCSS,Sass  CSS  CSS  (variables) (nested rules) (mixins) (inline import),.  </p>\n<h3 id=\"rubysass\">RubySass</h3>\n<p>PycharmScss,ScssRuby,,Ruby,<a href=\"https://rubyinstaller.org/downloads/\" target=\"_blank\" title=\"\"></a>,,next,<code>cmd</code>,<code>ruby -v</code><code>ruby</code>ruby,,<code>sass</code>,<code>cmd</code><code>gem install sass</code>,!  </p>\n<h3 id=\"pycharmfile-watcher\">Pycharmfile watcher</h3>\n<p><code>File -&gt; Settings -&gt; Tools -&gt; File Watchers</code><code>+</code><code>SCSS</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-Scss\">Name: SCSS  \nFile type: SCSS Style Sheet  \nScope: Project  \nProgram: sass  \nArguments: --style expanded --no-cache --update $FilePath$  \nOutput paths to refresh: $FileName$:$ProjectFileDir$/css/$FileNameWithoutExtension$.css  </code></pre>\n\n\n<p><code>SCSS</code>~</p>',368,0,'2019-04-26 17:13:33.021683','2019-05-03 15:59:13.605547',1,5,1,'p'),(3,'',',,css3',',,css3\r\n### ,css\r\n### overflow\r\n|   |   |\r\n| :------------: | :------------: |\r\n|  visible |  . |\r\n|  hidden |   |\r\n|  scroll |   |\r\n|  auto | ,  |\r\n|  inherit |  overflow |\r\n\r\n### text-overflow\r\n|   |   |\r\n| :------------: | :------------: |\r\n|  clip |   |\r\n|  elipsis |  |\r\n|  string |   |\r\n\r\n### white-space\r\n|   |   |\r\n| :------------: | :------------: |\r\n|  normal |  . |\r\n|  nowrap |   |\r\n|  inherit |  white-space   |\r\n\r\n### \r\n\r\n```css\r\noverflow: hidden;\r\ntext-overflow: ellipsis;\r\nwhite-space: nowrap;\r\n```\r\n![](/media/upimg/text-overflow_20190330005419_840.png)\r\n\r\n### \r\n```css\r\n/* WebKitCSSWebKit */\r\ndisplay: -webkit-box;\r\n/*  */\r\n-webkit-box-orient: vertical;\r\n/*  */\r\n-webkit-line-clamp: 3;\r\n/*  WebKit */\r\noverflow: hidden;\r\n```\r\n![](/media/upimg/text-overflow-clamp_20190330005725_841.png)\r\n\r\n[w3school](http://www.w3school.com.cn/ \"w3school\"){:traget=_blank}','article_img/2019/04/27/css.jpg','<p>,,css3  </p>\n<h3 id=\"css\">,css</h3>\n<h3 id=\"overflow\">overflow</h3>\n<table>\n<thead>\n<tr>\n<th align=\"center\"></th>\n<th align=\"center\"></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align=\"center\">visible</td>\n<td align=\"center\">.</td>\n</tr>\n<tr>\n<td align=\"center\">hidden</td>\n<td align=\"center\"></td>\n</tr>\n<tr>\n<td align=\"center\">scroll</td>\n<td align=\"center\"></td>\n</tr>\n<tr>\n<td align=\"center\">auto</td>\n<td align=\"center\">,</td>\n</tr>\n<tr>\n<td align=\"center\">inherit</td>\n<td align=\"center\">overflow</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"text-overflow\">text-overflow</h3>\n<table>\n<thead>\n<tr>\n<th align=\"center\"></th>\n<th align=\"center\"></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align=\"center\">clip</td>\n<td align=\"center\"></td>\n</tr>\n<tr>\n<td align=\"center\">elipsis</td>\n<td align=\"center\"></td>\n</tr>\n<tr>\n<td align=\"center\">string</td>\n<td align=\"center\"></td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"white-space\">white-space</h3>\n<table>\n<thead>\n<tr>\n<th align=\"center\"></th>\n<th align=\"center\"></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align=\"center\">normal</td>\n<td align=\"center\">.</td>\n</tr>\n<tr>\n<td align=\"center\">nowrap</td>\n<td align=\"center\"></td>\n</tr>\n<tr>\n<td align=\"center\">inherit</td>\n<td align=\"center\"> white-space </td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"_1\"></h3>\n<pre class=\"codehilite\"><code class=\"language-css\">overflow: hidden;  \ntext-overflow: ellipsis;  \nwhite-space: nowrap;  </code></pre>\n\n\n<p><img alt=\"\" src=\"/media/upimg/text-overflow_20190330005419_840.png\" />  </p>\n<h3 id=\"_2\"></h3>\n<pre class=\"codehilite\"><code class=\"language-css\">/* WebKitCSSWebKit */  \ndisplay: -webkit-box;  \n/*  */  \n-webkit-box-orient: vertical;  \n/*  */  \n-webkit-line-clamp: 3;  \n/*  WebKit */  \noverflow: hidden;  </code></pre>\n\n\n<p><img alt=\"\" src=\"/media/upimg/text-overflow-clamp_20190330005725_841.png\" />  </p>\n<p><a href=\"http://www.w3school.com.cn/\" title=\"w3school\" traget=\"_blank\">w3school</a></p>',243,22,'2019-04-27 23:35:19.364581','2019-05-03 15:59:31.274463',1,4,1,'p'),(4,',,',',,float, position,flex,,',',,float, position,flex,,\r\n### : float\r\n```html\r\n<section class=\"layout float\">\r\n    <div  class=\"left\"></div>\r\n    <div class=\"right\"></div>\r\n    <div class=\"center\">\r\n        <h1></h1>\r\n    </div>\r\n</section>\r\n```\r\n```css\r\n.left {\r\nwidth: 300px;\r\n	background-color: red;\r\n}\r\n.right {\r\n	width: 300px;\r\n	background-color: blue;\r\n}\r\n.float .left {\r\n	float: left;\r\n}\r\n.float .right {\r\n	float: right;\r\n}\r\nsection.layout div {\r\n	min-height: 100px;\r\n}\r\n.center {\r\n	background-color: yellow;\r\n}\r\n```\r\n### : position\r\n```html\r\n<section class=\"layout position\">\r\n	<div class=\"right\"></div>\r\n	<div class=\"left\"></div>\r\n	<div class=\"center\">\r\n		<h1></h1>\r\n	</div>\r\n</section>\r\n```\r\n```css\r\nsection.position {\r\n	position: relative;\r\n}\r\n\r\nsection.position .left {\r\n	position: absolute;\r\n	left: 0;\r\n}\r\n\r\nsection.position .right {\r\n	position: absolute;\r\n	right: 0;\r\n}\r\n\r\nsection.position .center {\r\n	margin-left: 300px;\r\n	margin-right: 300px;\r\n}\r\n```','article_img/2019/04/27/html5.jpg','<p>,,float, position,flex,,  </p>\n<h3 id=\"float\">: float</h3>\n<pre class=\"codehilite\"><code class=\"language-html\">&lt;section class=&quot;layout float&quot;&gt;  \n    &lt;div  class=&quot;left&quot;&gt;&lt;/div&gt;  \n    &lt;div class=&quot;right&quot;&gt;&lt;/div&gt;  \n    &lt;div class=&quot;center&quot;&gt;  \n        &lt;h1&gt;&lt;/h1&gt;  \n    &lt;/div&gt;  \n&lt;/section&gt;  </code></pre>\n\n\n<pre class=\"codehilite\"><code class=\"language-css\">.left {  \nwidth: 300px;  \n    background-color: red;  \n}  \n.right {  \n    width: 300px;  \n    background-color: blue;  \n}  \n.float .left {  \n    float: left;  \n}  \n.float .right {  \n    float: right;  \n}  \nsection.layout div {  \n    min-height: 100px;  \n}  \n.center {  \n    background-color: yellow;  \n}  </code></pre>\n\n\n<h3 id=\"position\">: position</h3>\n<pre class=\"codehilite\"><code class=\"language-html\">&lt;section class=&quot;layout position&quot;&gt;  \n    &lt;div class=&quot;right&quot;&gt;&lt;/div&gt;  \n    &lt;div class=&quot;left&quot;&gt;&lt;/div&gt;  \n    &lt;div class=&quot;center&quot;&gt;  \n        &lt;h1&gt;&lt;/h1&gt;  \n    &lt;/div&gt;  \n&lt;/section&gt;  </code></pre>\n\n\n<pre class=\"codehilite\"><code class=\"language-css\">section.position {  \n    position: relative;  \n}  \n\nsection.position .left {  \n    position: absolute;  \n    left: 0;  \n}  \n\nsection.position .right {  \n    position: absolute;  \n    right: 0;  \n}  \n\nsection.position .center {  \n    margin-left: 300px;  \n    margin-right: 300px;  \n}  </code></pre>',132,11,'2019-04-27 23:37:18.808413','2019-05-03 15:59:47.395158',1,4,1,'p'),(5,'var,letconst','ES6  ECMAScript 6.0  JavaScript 2015.06  ES2015ES2016ES2017 ES6  ES5 ','ES6  ECMAScript 6.0  JavaScript 2015.06  ES2015ES2016ES2017 ES6  ES5 \r\n### var\r\n`var`,,,,,.\r\n```javascript\r\nconsole.log(a) // undefined\r\nvar a = 1;\r\nvar a = 2;\r\nconsole.log(a) // 2\r\n```\r\n,,,,,`let`\r\n\r\n### let\r\n,var,,{},ES6let,var\r\n```javascript\r\nlet a = 1;\r\nlet a = 5;\r\nconsole.log(a);\r\n// (a) Identifier \'a\' has already been declared\r\n{\r\nlet b = 1;\r\n}\r\nconsole.log(b); // ReferenceError: b is not defined\r\n```\r\n\r\n```javascript\r\nconsole.log(a); // ReferenceError: a is not defined\r\nlet a = 1;\r\nlet b;\r\nconsole.log(b) // undefined\r\n```\r\n5`li`,`li`\r\n```javascript\r\nfor(var i = 0; i < 5; i++){\r\n	aLi[i].i = i;\r\n	aLi[i].onclick = function () {\r\n		alert(this.i) // 0 1 2 3 4\r\n	}\r\n}\r\n```\r\n`li``i`,JS,`for`,,`i`,`click`\r\n:\r\n1. \r\n\r\n```javascript\r\nlet aLi = document.getElementsByTagName(\'li\');\r\nfor(var i = 0; i < 5; i++){\r\n	(function (i){\r\n		aLi[i].onclick = function () {\r\n			alert(i) // 0 1 2 3 4\r\n		}\r\n	})(i)\r\n}\r\n```\r\n2. \r\n\r\n```javascript\r\nfor(var i = 0; i < 5; i++){\r\n	aLi[i].i = i;\r\n	// \r\n	aLi[i].onclick = function () {\r\n		alert(this.i) // 0 1 2 3 4\r\n		// this.ii\r\n	}\r\n}\r\n```\r\n,,,`var``let`,\r\n```javascript\r\nfor(let i = 0; i < 5; i++){\r\n	aLi[i].onclick = function () {\r\n		alert(i) // 0 1 2 3 4\r\n	}\r\n}\r\n```\r\n### const\r\n`const`,\r\n\r\n```javascript\r\nconst TYPE;\r\n// ,  Missing initializer in const declaration\r\n\r\nconst TYPE = 1;\r\nTYPE = 2;\r\n// , Assignment to constant variable.\r\n```\r\n:\r\n\r\n`let`;`let`  `const` ;`const` ;,','article_img/2019/04/27/js.jpg','<p>ES6  ECMAScript 6.0  JavaScript 2015.06  ES2015ES2016ES2017 ES6  ES5   </p>\n<h3 id=\"var\">var</h3>\n<p><code>var</code>,,,,,.  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">console.log(a) // undefined  \nvar a = 1;  \nvar a = 2;  \nconsole.log(a) // 2  </code></pre>\n\n\n<p>,,,,,<code>let</code>  </p>\n<h3 id=\"let\">let</h3>\n<p>,var,,{},ES6let,var  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">let a = 1;  \nlet a = 5;  \nconsole.log(a);  \n// (a) Identifier \'a\' has already been declared  \n{  \nlet b = 1;  \n}  \nconsole.log(b); // ReferenceError: b is not defined  </code></pre>\n\n\n<p>  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">console.log(a); // ReferenceError: a is not defined  \nlet a = 1;  \nlet b;  \nconsole.log(b) // undefined  </code></pre>\n\n\n<p>5<code>li</code>,<code>li</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">for(var i = 0; i &lt; 5; i++){  \n    aLi[i].i = i;  \n    aLi[i].onclick = function () {  \n        alert(this.i) // 0 1 2 3 4  \n    }  \n}  </code></pre>\n\n\n<p><code>li</code><code>i</code>,JS,<code>for</code>,,<code>i</code>,<code>click</code><br />\n:<br />\n1.   </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">let aLi = document.getElementsByTagName(\'li\');  \nfor(var i = 0; i &lt; 5; i++){  \n    (function (i){  \n        aLi[i].onclick = function () {  \n            alert(i) // 0 1 2 3 4  \n        }  \n    })(i)  \n}  </code></pre>\n\n\n<ol>\n<li>  </li>\n</ol>\n<pre class=\"codehilite\"><code class=\"language-javascript\">for(var i = 0; i &lt; 5; i++){  \n    aLi[i].i = i;  \n    //   \n    aLi[i].onclick = function () {  \n        alert(this.i) // 0 1 2 3 4  \n        // this.ii  \n    }  \n}  </code></pre>\n\n\n<p>,,,<code>var</code><code>let</code>,  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">for(let i = 0; i &lt; 5; i++){  \n    aLi[i].onclick = function () {  \n        alert(i) // 0 1 2 3 4  \n    }  \n}  </code></pre>\n\n\n<h3 id=\"const\">const</h3>\n<p><code>const</code>,  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">const TYPE;  \n// ,  Missing initializer in const declaration  \n\nconst TYPE = 1;  \nTYPE = 2;  \n// , Assignment to constant variable.  </code></pre>\n\n\n<p>:  </p>\n<p><code>let</code>;<code>let</code>  <code>const</code> ;<code>const</code> ;,</p>',51,1,'2019-04-27 23:38:55.291931','2019-05-03 16:00:00.633546',1,3,1,'p'),(6,'','ES6Arrow Function,\r\nthisargumentssuper new.target','ES6Arrow Function,\r\nthisargumentssuper new.target\r\n,:\r\n```javascript\r\nfunction fn(){\r\n	console.log(\'hello~\')\r\n}\r\nfn() // hello~\r\n```\r\n\r\n```javascript\r\nfn = () => {\r\n	console.log(\'hello~\')\r\n}\r\nfn() // hello~\r\n```\r\n,,,`{}`\r\n```javascript\r\nfn = () => console.log(\'hello~\')\r\nfn() // hello~\r\n```\r\n?\r\n```javascript\r\n// \r\nfn = (a) => a + 2\r\n// \r\nfn =a => a + 2\r\n\r\n// \r\nfn = (a,b,c) a + b + c\r\n```\r\n:\r\n```javascript\r\nconst Person = {\r\n	name: \'Superficial\',\r\n	age:23,\r\n	\'get\': function() {\r\n		setInterval(function (){\r\n			console.log(this.age)\r\n		})\r\n	}\r\n}\r\nPerson.get() // undefined\r\n```\r\n,,,,[this](https://bonsaiden.github.io/JavaScript-Garden/zh/#function.this \"this\"){:target=_blank}\r\nthis\r\n```javascript\r\nconst Person = {\r\n	name: \'Superficial\',\r\n	age:23,\r\n	\'get\': function() {\r\n		let that = this;\r\n		setInterval(function (){\r\n			console.log(that.age)\r\n		})\r\n	}\r\n}\r\nPerson.get() // 23\r\n```\r\n\r\n[](https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Functions/Arrow_functions#Syntax \"\"){:target=_blank}','article_img/2019/04/27/js_hZa2ADX.jpg','<p>ES6Arrow Function,<br />\nthisargumentssuper new.target<br />\n,:  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">function fn(){  \n    console.log(\'hello~\')  \n}  \nfn() // hello~  </code></pre>\n\n\n<p>  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">fn = () =&gt; {  \n    console.log(\'hello~\')  \n}  \nfn() // hello~  </code></pre>\n\n\n<p>,,,<code>{}</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">fn = () =&gt; console.log(\'hello~\')  \nfn() // hello~  </code></pre>\n\n\n<p>?  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">//   \nfn = (a) =&gt; a + 2  \n//   \nfn =a =&gt; a + 2  \n\n//   \nfn = (a,b,c) a + b + c  </code></pre>\n\n\n<p>:  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">const Person = {  \n    name: \'Superficial\',  \n    age:23,  \n    \'get\': function() {  \n        setInterval(function (){  \n            console.log(this.age)  \n        })  \n    }  \n}  \nPerson.get() // undefined  </code></pre>\n\n\n<p>,,,,<a href=\"https://bonsaiden.github.io/JavaScript-Garden/zh/#function.this\" target=\"_blank\" title=\"this\">this</a><br />\nthis  </p>\n<pre class=\"codehilite\"><code class=\"language-javascript\">const Person = {  \n    name: \'Superficial\',  \n    age:23,  \n    \'get\': function() {  \n        let that = this;  \n        setInterval(function (){  \n            console.log(that.age)  \n        })  \n    }  \n}  \nPerson.get() // 23  </code></pre>\n\n\n<p><a href=\"https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Functions/Arrow_functions#Syntax\" target=\"_blank\" title=\"\"></a></p>',225,2,'2019-04-27 23:40:42.130042','2019-05-03 16:00:16.103025',1,3,1,'p'),(7,'djangositemap','Sitemap Sitemap XML ','Sitemap Sitemap XML \r\n\r\n`django``sitemap`,APP`settings.py``INSTALL_APP`,`pip`,`django`1.6`site`,~\r\n```django\r\nINSTALL_APP = [\r\n	\'\'\',\r\n	\'django.contrib.sites\',\r\n	\'django.contrib.sitemaps\',\r\n]\r\nSITE_ID = 1\r\n```\r\nSITE_ID= 1,,\r\n,(SITE)\r\n![](/media/editor/site_20190424150435619391.png \"\")\r\n,127.0.0.1:8000\r\n### sitemap\r\n`sitemap.py`\r\n```django\r\nfrom django.contrib.sitemaps import Sitemap\r\nfrom apps.blog.models import Article, Category, Tag\r\nfrom django.urls import reverse\r\n\r\nclass ArticleSiteMap(Sitemap):\r\n    \"\"\"changefreq \r\n        priority \"\"\"\r\n    changefreq = \"monthly\"\r\n    priority = \"0.6\"\r\n\r\n    def items(self):\r\n        return Article.objects.all()\r\n\r\n    def lastmod(self, obj):\r\n        \"\"\"\"\"\"\r\n        return obj.modified_time\r\n\r\n    def location(self, obj):\r\n        \"\"\"..get_absolute_url(),location\"\"\"\r\n        return reverse(\'blog:detail\', kwargs={\'pk\': int(obj.id)})\r\n\r\n\r\nclass CategorySiteMap(Sitemap):\r\n    changefreq = \"Weekly\"\r\n    priority = \"0.6\"\r\n\r\n    def items(self):\r\n        return Category.objects.all()\r\n\r\n    def lastmod(self, obj):\r\n        return obj.modified_time\r\n\r\n    def location(self, obj):\r\n        \"\"\"..get_absolute_url(),location\"\"\"\r\n        return reverse(\'blog:category\', kwargs={\'pk\': int(obj.id)})\r\n\r\n\r\nclass TagSiteMap(Sitemap):\r\n    \"\"\"\r\n        changefreq \r\n        priority \r\n    \"\"\"\r\n    changefreq = \"Weekly\"\r\n    priority = \"0.3\"\r\n\r\n    def items(self):\r\n        return Tag.objects.all()\r\n\r\n    def lastmod(self, obj):\r\n        return obj.modified_time\r\n\r\n    def location(self, obj):\r\n        \"\"\"..get_absolute_url(),location\"\"\"\r\n        return reverse(\'blog:tags\', kwargs={\'pk\': obj.id})\r\n```\r\n### urls.py\r\n```django\r\nfrom DjangoBlog.sitemap import ArticleSiteMap, CategorySiteMap, TagSiteMap\r\nsitemaps = {\r\n    \'blog\': ArticleSiteMap,\r\n    \'Category\': CategorySiteMap,\r\n    \'Tag\': TagSiteMap,\r\n}\r\n\r\nre_path(r\'^sitemap\\.xml$\', sitemap, {\'sitemaps\': sitemaps},\r\n        name=\'django.contrib.sitemaps.views.sitemap\'),\r\n```\r\n: http://127.0.0.1:8000/sitemap.xml','article_img/2019/04/27/django.jpg','<p>Sitemap Sitemap XML   </p>\n<p><code>django</code><code>sitemap</code>,APP<code>settings.py</code><code>INSTALL_APP</code>,<code>pip</code>,<code>django</code>1.6<code>site</code>,~  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">INSTALL_APP = [  \n    \'\'\',  \n    \'django.contrib.sites\',  \n    \'django.contrib.sitemaps\',  \n]  \nSITE_ID = 1  </code></pre>\n\n\n<p>SITE_ID= 1,,<br />\n,(SITE)<br />\n<img alt=\"\" src=\"/media/editor/site_20190424150435619391.png\" title=\"\" /><br />\n,127.0.0.1:8000  </p>\n<h3 id=\"sitemap\">sitemap</h3>\n<p><code>sitemap.py</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">from django.contrib.sitemaps import Sitemap  \nfrom apps.blog.models import Article, Category, Tag  \nfrom django.urls import reverse  \n\nclass ArticleSiteMap(Sitemap):  \n    &quot;&quot;&quot;changefreq   \n        priority &quot;&quot;&quot;  \n    changefreq = &quot;monthly&quot;  \n    priority = &quot;0.6&quot;  \n\n    def items(self):  \n        return Article.objects.all()  \n\n    def lastmod(self, obj):  \n        &quot;&quot;&quot;&quot;&quot;&quot;  \n        return obj.modified_time  \n\n    def location(self, obj):  \n        &quot;&quot;&quot;..get_absolute_url(),location&quot;&quot;&quot;  \n        return reverse(\'blog:detail\', kwargs={\'pk\': int(obj.id)})  \n\n\nclass CategorySiteMap(Sitemap):  \n    changefreq = &quot;Weekly&quot;  \n    priority = &quot;0.6&quot;  \n\n    def items(self):  \n        return Category.objects.all()  \n\n    def lastmod(self, obj):  \n        return obj.modified_time  \n\n    def location(self, obj):  \n        &quot;&quot;&quot;..get_absolute_url(),location&quot;&quot;&quot;  \n        return reverse(\'blog:category\', kwargs={\'pk\': int(obj.id)})  \n\n\nclass TagSiteMap(Sitemap):  \n    &quot;&quot;&quot;  \n        changefreq   \n        priority   \n    &quot;&quot;&quot;  \n    changefreq = &quot;Weekly&quot;  \n    priority = &quot;0.3&quot;  \n\n    def items(self):  \n        return Tag.objects.all()  \n\n    def lastmod(self, obj):  \n        return obj.modified_time  \n\n    def location(self, obj):  \n        &quot;&quot;&quot;..get_absolute_url(),location&quot;&quot;&quot;  \n        return reverse(\'blog:tags\', kwargs={\'pk\': obj.id})  </code></pre>\n\n\n<h3 id=\"urlspy\">urls.py</h3>\n<pre class=\"codehilite\"><code class=\"language-django\">from DjangoBlog.sitemap import ArticleSiteMap, CategorySiteMap, TagSiteMap  \nsitemaps = {  \n    \'blog\': ArticleSiteMap,  \n    \'Category\': CategorySiteMap,  \n    \'Tag\': TagSiteMap,  \n}  \n\nre_path(r\'^sitemap\\.xml$\', sitemap, {\'sitemaps\': sitemaps},  \n        name=\'django.contrib.sitemaps.views.sitemap\'),  </code></pre>\n\n\n<p>: http://127.0.0.1:8000/sitemap.xml</p>',48,0,'2019-04-27 23:42:35.398521','2019-05-03 16:00:41.824563',1,1,1,'p'),(8,'git','git,,,,','git,,,,\r\ngit\r\n\r\n### SSH\r\n\r\n```git\r\nssh-keygen -t ras -C \"your email\"\r\n// ,,,\r\n```\r\n### \r\n```git\r\ngit config --global user.name \"your username\"\r\ngit config --global user.email \"your email\"\r\n```\r\n### \r\n\r\n```git\r\ngit init\r\n# md\r\ntouch README.md\r\ngit add .\r\n# \r\ngit add filename\r\n# \r\ngit status\r\n# \r\n# \r\ngit commit -m \"\"\r\n# push\r\ngit remote add origin\r\ngit push -u origin master\r\n```\r\n\r\n### pushhttps push,?\r\n```git\r\ngit remote rm origin\r\n// \r\ngit remote add origin git@github.com:gitname/test.git\r\n// \r\n```\r\n\r\n\r\n### clone\r\n```git\r\ngit clone url\r\n// \r\ngit checkout -- filename\r\n// \r\ngit rm --cached filename\r\n// adddelete\r\ngit reset HEAD filename  \r\n// delete\r\ngit stash               // git\r\nstash pop                  // \r\n```\r\n### \