s, **kwargs)  \n\n    def viewed(self):  \n        #   \n        self.views += 1  \n        self.save(update_fields=[\'views\'])  \n\n    def next_article(self):  \n        #   \n        return Article.objects.filter(id__gt=self.id).order_by(\'id\').first()  \n\n    def prev_article(self):  \n        #   \n        return Article.objects.filter(id__lt=self.id).order_by(\'id\').last()  \n\n    class Meta:  \n        verbose_name = \'\'  \n        verbose_name_plural = verbose_name  \n\n    def __str__(self):  \n        return self.title  </code></pre>\n\n\n<h3 id=\"_4\"></h3>\n<p>!,,,,,,  </p>\n<pre class=\"codehilite\"><code class=\"language-python\">class Link(models.Model):  \n    &quot;&quot;&quot;&quot;&quot;&quot;  \n    name = models.CharField(verbose_name=\'\', max_length=40)  \n    link_url = models.URLField(verbose_name=\'\', max_length=100)  \n    is_active = models.BooleanField(\'\', default=True)  \n    is_show = models.BooleanField(\'\', default=False)  \n\n    def active_to_false(self):  \n        self.is_active = False  \n        self.save(update_fields=[\'is_active\'])  \n\n    def show_to_false(self):  \n        self.is_show = True  \n        self.save(update_fields=[\'is_show\'])  \n\n    def __str__(self):  \n        return self.name  \n\n    class Meta:  \n        verbose_name = \'\'  \n        verbose_name_plural = verbose_name  </code></pre>\n\n\n<h3 id=\"_5\"></h3>\n<p>,  </p>\n<pre class=\"codehilite\"><code class=\"language-python\">class Banner(models.Model):  \n    &quot;&quot;&quot;&quot;&quot;&quot;  \n    title = models.CharField(\'\', max_length=50, default=\'\')  \n    img = models.ImageField(\'\', upload_to=\'banner/\')  \n    link_url = models.URLField(\'\', max_length=100)  \n    is_active = models.BooleanField(\'\', default=False)  \n\n    def __str__(self):  \n        return self.title  \n\n    class Meta:  \n        verbose_name = \'\'  \n        verbose_name_plural = verbose_name  </code></pre>\n\n\n<h3 id=\"_6\">,</h3>\n<pre class=\"codehilite\"><code class=\"language-python\">from django.contrib import admin  \nfrom .models import Banner, Navigation, Category, Tag, Tui, Article, Link  \n\n\n@admin.register(Article)  \nclass ArticleAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'title\', \'tui\', \'user\', \'views\', \'comment_count\', \'created_time\')  \n    list_filter = (\'tui\', \'user\', \'created_time\')  \n    #   \n    list_per_page = 50  \n    # 50  \n    ordering = (\'-created_time\',)  \n    #   \n    list_display_links = (\'id\', \'title\')  \n\n\n@admin.register(Banner)  \nclass BannerAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'text_info\', \'img\', \'link_url\', \'is_active\')  \n    list_filter = (\'text_info\', \'img\', \'link_url\', \'is_active\')  \n\n\n@admin.register(Navigation)  \nclass NavigationAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'name\')  \n    list_filter = (\'name\',)  \n\n\n@admin.register(Category)  \nclass CategoryAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'name\')  \n    list_filter = (\'name\',)  \n\n\n@admin.register(Tag)  \nclass TagAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'name\')  \n    list_filter = (\'name\',)  \n\n\n@admin.register(Tui)  \nclass TuiAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'name\')  \n    list_filter = (\'name\',)  \n\n\n@admin.register(Link)  \nclass LinkAdmin(admin.ModelAdmin):  \n    list_display = (\'id\', \'name\', \'link_url\')  \n    list_filter = (\'name\', \'link_url\')  </code></pre>\n\n\n<p>Pycharmterminal<br />\n <code>python manage.py makemigrations</code><br />\n<code>python manage.py migrate</code></p>',300,0,'2019-04-29 13:30:56.735511','2019-05-03 16:01:48.870856',1,1,1,'d'),(14,'()','django,,,,','django,,,,\r\n\r\n### \r\n`python manage.py createsuperuser`\r\n\r\n,,,,,,,,!\r\n\r\n`python manage.py runserver`\r\n\r\n\r\n\r\n### \r\nfbv,cbv\r\n```python\r\n\r\n```','article_img/2019/04/29/django_pn3KmS4.jpg','<p>django,,,,  </p>\n<h3 id=\"_1\"></h3>\n<p><code>python manage.py createsuperuser</code>  </p>\n<p>,,,,,,,,!  </p>\n<p><code>python manage.py runserver</code>  </p>\n<p>  </p>\n<h3 id=\"_2\"></h3>\n<p>fbv,cbv  </p>\n<pre class=\"codehilite\"><code class=\"language-python\"></code></pre>',126,0,'2019-04-29 13:31:35.692877','2019-05-03 16:01:56.794576',1,1,NULL,'d'),(15,'Gird','<p>Grid  CSS  flexbox Grid  CSS   ( Grid Container )  Grid Items  Grid()   </p>\n<p>Gird<code>di','Grid  CSS  flexbox Grid  CSS   ( Grid Container )  Grid Items  Grid() \r\n\r\nGird`display: grid`,grid,\r\n#### (Grid Container)\r\n```css\r\ndisplay: grid || inline-grid;\r\n// ,||\r\ngrid-template-columns: 25% 25% 25% 25%;\r\n// ,\r\ngrid-template-rows: 25% 100px auto;\r\n// ,\r\ngrid-column-gap\r\n// \r\ngrid-column-gap\r\n// \r\njustify-items:start | end | center | stretch();\r\n// ,|||\r\nalign-items: start | end | center | stretch;\r\n// ,|||\r\njustify-content: start | end | center | stretch | space-around | space-between | space-evenly;\r\n// \r\nalign-content: start | end | center | stretch | space-around | space-between | space-evenly;\r\n// \r\n```\r\n#### \r\n```css\r\ngrid-column-start\r\ngrid-column-end\r\ngrid-row-start\r\ngrid-row-end\r\n```','article_img/2019/05/02/grid.png','<p>Grid  CSS  flexbox Grid  CSS   ( Grid Container )  Grid Items  Grid()   </p>\n<p>Gird<code>display: grid</code>,grid,  </p>\n<h4 id=\"grid-container\">(Grid Container)</h4>\n<pre class=\"codehilite\"><code class=\"language-css\">display: grid || inline-grid;  \n// ,||  \ngrid-template-columns: 25% 25% 25% 25%;  \n// ,  \ngrid-template-rows: 25% 100px auto;  \n// ,  \ngrid-column-gap  \n//   \ngrid-column-gap  \n//   \njustify-items:start | end | center | stretch();  \n// ,|||  \nalign-items: start | end | center | stretch;  \n// ,|||  \njustify-content: start | end | center | stretch | space-around | space-between | space-evenly;  \n//   \nalign-content: start | end | center | stretch | space-around | space-between | space-evenly;  \n//   </code></pre>\n\n\n<h4 id=\"_1\"></h4>\n<pre class=\"codehilite\"><code class=\"language-css\">grid-column-start  \ngrid-column-end  \ngrid-row-start  \ngrid-row-end  </code></pre>',13,0,'2019-04-29 18:08:21.200575','2019-05-07 06:44:01.681828',1,4,NULL,'p'),(17,'djangoJWT','SessionJson Web Token','SessionJson Web Token\r\n\r\n##### django-rest-framework\r\n`pip install djangorestframework djangorestframework-jwt`\r\n\r\n`settings.py- -> INSTALL-APP`\r\n```django\r\nINSTALLED_APPS = [\r\n    ...\r\n    \'rest_framework\',\r\n    \'rest_framework.authtoken\',\r\n]\r\n```\r\n,`rest_framework.authtoken``token`\r\n```django\r\npython manage.py makemigrations\r\npython manage.py migrate\r\n```\r\n`urls.py`\r\n```django\r\nfrom rest_framework_jwt.views import obtain_jwt_token\r\nurlpatterns = [\r\n	re_path(r\'^login/\', obtain_jwt_token)\r\n]\r\n```\r\n,,`http://127.0.0.1/login` ,Token\r\n\r\n![](/media/editor/login_20190503132734817568.png \"\")','article_img/2019/05/03/django_UVFOZq2.jpg','<p>SessionJson Web Token  </p>\n<h5 id=\"django-rest-framework\">django-rest-framework</h5>\n<p><code>pip install djangorestframework djangorestframework-jwt</code>  </p>\n<p><code>settings.py- -&gt; INSTALL-APP</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">INSTALLED_APPS = [  \n    ...  \n    \'rest_framework\',  \n    \'rest_framework.authtoken\',  \n]  </code></pre>\n\n\n<p>,<code>rest_framework.authtoken</code><code>token</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">python manage.py makemigrations  \npython manage.py migrate  </code></pre>\n\n\n<p><code>urls.py</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">from rest_framework_jwt.views import obtain_jwt_token  \nurlpatterns = [  \n    re_path(r\'^login/\', obtain_jwt_token)  \n]  </code></pre>\n\n\n<p>,,<code>http://127.0.0.1/login</code> ,Token  </p>\n<p><img alt=\"\" src=\"/media/editor/login_20190503132734817568.png\" title=\"\" /></p>',8,0,'2019-05-03 13:26:35.347466','2019-05-03 16:02:11.519446',1,1,NULL,'p'),(24,'django','<p>django,,<br />\n(Accounts)<code>backends.py</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">from django.contrib.auth.backends','django,,\r\n(Accounts)`backends.py`\r\n```django\r\nfrom django.contrib.auth.backends import ModelBackend\r\nfrom django.db.models import Q\r\nfrom django.contrib.auth import get_user_model\r\nfrom django.contrib.auth.models import Permission\r\n\r\nUser = get_user_model()\r\n\r\n\r\nclass CustomBackend(ModelBackend):\r\n    \"\"\"\"\"\"\r\n\r\n    def authenticate(self, request, username=None, password=None, **kwargs):\r\n        # authenticate\r\n        user = User.objects.filter(Q(username=username) | Q(email=username)).first()\r\n        if user:\r\n            if user.check_password(password):\r\n                return user\r\n        return None\r\n```\r\n`settings.py`\r\n```django\r\n# \r\nAUTHENTICATION_BACKENDS = (\r\n    \'accounts.backends.CustomBackend\',\r\n	# django.contrib.auth.backends.ModelBackend\r\n	# django,\r\n\r\n)\r\n```\r\n[](https://docs.djangoproject.com/zh-hans/2.2/topics/auth/customizing/ \"\"){:targat=_blank}','article_img/2019/05/03/django_eUFXhNB.jpg','<p>django,,<br />\n(Accounts)<code>backends.py</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">from django.contrib.auth.backends import ModelBackend  \nfrom django.db.models import Q  \nfrom django.contrib.auth import get_user_model  \nfrom django.contrib.auth.models import Permission  \n\nUser = get_user_model()  \n\n\nclass CustomBackend(ModelBackend):  \n    &quot;&quot;&quot;&quot;&quot;&quot;  \n\n    def authenticate(self, request, username=None, password=None, **kwargs):  \n        # authenticate  \n        user = User.objects.filter(Q(username=username) | Q(email=username)).first()  \n        if user:  \n            if user.check_password(password):  \n                return user  \n        return None  </code></pre>\n\n\n<p><code>settings.py</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">#   \nAUTHENTICATION_BACKENDS = (  \n    \'accounts.backends.CustomBackend\',  \n    # django.contrib.auth.backends.ModelBackend  \n    # django,  \n\n)  </code></pre>\n\n\n<p><a href=\"https://docs.djangoproject.com/zh-hans/2.2/topics/auth/customizing/\" targat=\"_blank\" title=\"\"></a></p>',5,0,'2019-05-03 15:37:54.676761','2019-05-07 01:22:23.162526',1,1,NULL,'p'),(28,'django','<p>?<br />\n  </p>\n<h3 id=\"_1\"></h3>\n<p><code>Article</code><code>push</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-djan','?\r\n\r\n\r\n### \r\n`Article``push`\r\n```django\r\ndef push(self):\r\n    \"\"\"\"\"\"\r\n    if self.status == \'p\':\r\n        # \r\n        import requests\r\n        # http://data.zz.baidu.com/site/index \r\n        url = \'http://data.zz.baidu.com/urls?site=yours site&token=yours token\'\r\n		headers = {\r\n            \'Content-Type\': \'text/plain\'\r\n        }\r\n		article_list = list()\r\n        article_list.append(\'yous site/path/%s.html\' % (self.pk))\r\n        data = \'\\n\'.join(article_list)\r\n		req = requests.post(url, headers=headers, data=data)\r\n        res = req.json()\r\n        print(res, \'\')\r\n```','article_img/2019/05/03/django_8XAG3vI.jpg','<p>?<br />\n  </p>\n<h3 id=\"_1\"></h3>\n<p><code>Article</code><code>push</code>  </p>\n<pre class=\"codehilite\"><code class=\"language-django\">def push(self):  \n    &quot;&quot;&quot;&quot;&quot;&quot;  \n    if self.status == \'p\':  \n        #   \n        import requests  \n        # http://data.zz.baidu.com/site/index   \n        url = \'http://data.zz.baidu.com/urls?site=yours site&amp;token=yours token\'  \n        headers = {  \n            \'Content-Type\': \'text/plain\'  \n        }  \n        article_list = list()  \n        article_list.append(\'yous site/path/%s.html\' % (self.pk))  \n        data = \'\\n\'.join(article_list)  \n        req = requests.post(url, headers=headers, data=data)  \n        res = req.json()  \n        print(res, \'\')  </code></pre>',6,0,'2019-05-03 18:47:17.250151','2019-05-07 17:19:03.948909',1,1,NULL,'p');
